const SingleVacation = () => {
  const { id } = useParams<{ id: string }>();
  const vacation = data.find((vaycay) => vaycay.city === id);
  return;
  <>
    <VacationHero />
    <div>SingleVacation</div>;
  </>;
};

export default SingleVacation;
